import React from "react";
import styled from "styled-components";

function LoginTitle() {
  return <Text>Mac Sucatas</Text>;
}

const Text = styled.h1`
  height: auto;
  letter-spacing: 4px;
  text-transform: uppercase;
  font-size: 45px;
`;

export default LoginTitle;
